    if (!opts)
        return;
    if (!data)
        return;
    const { margins, canvasWidth, canvasHeight, visibleStartTimeSec, visibleEndTimeSec, minAmp, maxAmp } = opts;
    // this is important because main thread no longer has control of canvas (it seems)
